css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("reddit.com") {
	.expando-button {
		opacity:             0.775 !important;
		background-position: 0 0 !important;
		background-size:     23px !important;
	}

	.expando-button:hover {
		opacity: 0.925 !important;
		cursor:  pointer !important;
	}

	/* Text, collapsed */
	.expando-button.selftext.collapsed {
		background-image: url('data:image/png;base64,') !important;
	}

	/* Text, expanded */
	.expando-button.selftext.expanded {
		background-image: url('data:image/png;base64,') !important;
	}




	/* Image, collapsed */
	.expando-button.image.collapsed,
	.expando-button.video-muted.collapsed {
		background-image: url('data:image/png;base64,') !important;
	}

	/* Image, expanded */
	.expando-button.image.expanded,
	.expando-button.video-muted.expanded {
		background-image: url('data:image/png;base64,') !important;
	}




	/* Image gallery, collapsed */
	.expando-button.image.gallery.collapsed {
		background-image: url('data:image/png;base64,') !important;
	}

	/* Image gallery, expanded */
	.expando-button.image.gallery.expanded {
		background-image: url('data:image/png;base64,') !important;
	}




	/* Video, collapsed */
	.expando-button.video.collapsed {
		background-image: url('data:image/png;base64,') !important;
	}

	/* Video, expanded */
	.expando-button.video.expanded {
		background-image: url('data:image/png;base64,') !important;
	}
} /* eof */
